INSERT INTO blog_post VALUES(2,'假如生活欺骗了你',replace(replace('## 假如生活欺骗了你\r\n\r\n* 【作者】普希金 【朝代】现代\r\n\r\n假如生活欺骗了你\r\n\r\n不要悲伤，不要心急！\r\n\r\n忧郁的日子里须要镇静：\r\n\r\n相信吧，快乐的日子将会来临！\r\n\r\n心儿永远向往着未来；\r\n\r\n现在却常是忧郁。\r\n\r\n一切都是瞬息，一切都将会过去；\r\n\r\n而那过去了的，就会成为亲切的怀恋。','\r',char(13)),'\n',char(10)),'2019-12-19 16:07:16.503651','p','2019-12-22 12:33:58.299499');
INSERT INTO blog_post VALUES(3,'生如夏花',replace(replace('## 生如夏花\r\n\r\n* 泰戈尔\r\n\r\n生如夏花\r\n\r\n生命，一次又一次轻薄过\r\n\r\n轻狂不知疲倦\r\n\r\n——题记\r\n\r\n1\r\n\r\n我听见回声，来自山谷和心间\r\n\r\n以寂寞的镰刀收割空旷的灵魂\r\n\r\n不断地重复决绝，又重复幸福\r\n\r\n终有绿洲摇曳在沙漠\r\n\r\n我相信自己\r\n\r\n生来如同璀璨的夏日之花\r\n\r\n不凋不败，妖冶如火\r\n\r\n承受心跳的负荷和呼吸的累赘\r\n\r\n乐此不疲\r\n\r\n2\r\n\r\n我听见音乐，来自月光和胴体\r\n\r\n辅极端的诱饵捕获飘渺的唯美\r\n\r\n一生充盈着激烈，又充盈着纯然\r\n\r\n总有回忆贯穿于世间\r\n\r\n我相信自己\r\n\r\n死时如同静美的秋日落叶\r\n\r\n不盛不乱，姿态如烟\r\n\r\n即便枯萎也保留丰肌清骨的傲然\r\n\r\n玄之又玄\r\n\r\n3\r\n\r\n我听见爱情，我相信爱情\r\n\r\n爱情是一潭挣扎的蓝藻\r\n\r\n如同一阵凄微的风\r\n\r\n穿过我失血的静脉\r\n\r\n驻守岁月的信念\r\n\r\n4\r\n\r\n我相信一切能够听见\r\n\r\n甚至预见离散，遇见另一个自己\r\n\r\n而有些瞬间无法把握\r\n\r\n任凭东走西顾，逝去的必然不返\r\n\r\n请看我头置簪花，一路走来一路盛开\r\n\r\n频频遗漏一些，又深陷风霜雨雪的感动\r\n\r\n5\r\n\r\n般若波罗蜜，一声一声\r\n\r\n生如夏花之绚烂，死如秋叶之静美\r\n\r\n还在乎拥有什么','\r',char(13)),'\n',char(10)),'2019-12-19 16:12:04.179772','p','2019-12-22 12:33:58.299499');
